const quote = document.getElementById("quote")
const authorImage = document.getElementById("authorImage")
const author = document.getElementById("author")
const next = document.getElementById('next')
const prev = document.getElementById('pre')
let currentIndex = 1;

quote.textContent = quoteList[0].quote
authorImage.src = quoteList[0].img
author.textContent= quoteList[0].author

let play = setInterval(function () {
    if (currentIndex < quoteList.length) {
    quote.textContent = quoteList[currentIndex].quote
    authorImage.src = quoteList[currentIndex].img
        author.textContent = quoteList[currentIndex].author
        currentIndex++;
    } else {
        currentIndex =0
    }
}, 2000)


next.addEventListener('click', () => {
    clearInterval(play)
    if (currentIndex < quoteList.length) {
    quote.textContent = quoteList[currentIndex].quote
    authorImage.src = quoteList[currentIndex].img
        author.textContent = quoteList[currentIndex].author
        currentIndex++;
    } else {
        currentIndex =0
    }
})

prev.addEventListener('click', () => {
    clearInterval(play)
    if (currentIndex >= 0 && currentIndex < quoteList.length) {
    quote.textContent = quoteList[currentIndex].quote
    authorImage.src = quoteList[currentIndex].img
        author.textContent = quoteList[currentIndex].author
        currentIndex--;
    } else{
        currentIndex = quoteList.length-1
    }
})